import React from 'react';
import { Link } from 'react-router-dom';

export default function Nav() {
  return (
    <div>
      <Link to={`/`}>Home</Link>
      <Link to={`/signup`}>Sign Up</Link>
      <Link to={`/signin`}>Sign In</Link>
    </div>
  )
}
